import React from "react";
import styled from "styled-components";

const AboutContentsContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
`;

const AboutContents = () => {
  return (
    <AboutContentsContainer>
      <h1>심어진 왕뚱대지</h1>
    </AboutContentsContainer>
  );
};

export default AboutContents;
